import React, { useState } from 'react';
import axios from 'axios';

const Match = ({ favorites }) => {
  const [match, setMatch] = useState('');

  const handleMatch = async () => {
    try {
      const response = await axios.post(
        `https://frontend-take-home-service.fetch.com/dogs/match`,
        favorites.map((dog) => dog.id),
        {
          withCredentials: true,
          headers: {
            'fetch-api-key':'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpYXQiOjE2NzgzMDU2MTF9.Ky49nXH6qgHJQ0CBsZGYsP7_Is2am3u5j3RAdEl457s',
          },
        }
      );
      setMatch(response.data.match);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div>
      <button onClick={handleMatch}>Find a Match</button>
      {match && <p>You've been matched with dog ID {match}!</p>}
    </div>
  );
};

export default Match;
